import React from "react";
import { BrowserRouter, Route} from "react-router-dom";

function App(){
    return(
        <div>
            <h1>App component</h1>
            <BrowserRouter>
            <Route Path ="/" element = {<h2>Home Page</h2>} />
            </BrowserRouter>
        </div>
    )
}
export default App
